script: |
  super -f text -I q8121.spq | sort > q8121.out

inputs:
  - name: q8121.spq
    data: |
      SELECT ALL + col2 AS col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE + 49 BETWEEN - + col0 / + col1 + - + col0 AND 86 + + + col0;
  - name: tab0

outputs:
  - name: q8121.out
    data: |
      10
      47
      99
